import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Welcome to FocusLearn</h1>
        <p>Learn with Focus. Your journey starts here.</p>
      </header>
    </div>
  );
}

export default App;
